import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import styles from './consultasagendadas.module.css';

function ConsultasAgendadas() {
  const { state } = useLocation();

  if (!state) return <p>Sem dados para mostrar.</p>;

  return (
    <div>
      <h1>Detalhes da Consulta</h1>
      <p><strong>Pet:</strong> {state.pet}</p>
      <p><strong>Tutor:</strong> {state.nome_tutor}</p>
      <p><strong>Idade do Pet:</strong> {state.idade_pet}</p>
      <p><strong>Telefone:</strong> {state.Telefone}</p>
      <p><strong>Email:</strong> {state.Email}</p>
      <p><strong>Rua:</strong> {state.Rua}</p>
      <p><strong>Cidade:</strong> {state.Cidade}</p>
      <p><strong>Estado:</strong> {state.Estado}</p>
      <p><strong>Motivo:</strong> {state.Motivo}</p>
      <p><strong>Data:</strong> {state.Data}</p>
      <p><strong>Hor√°rio:</strong> {state.Horario}</p>
    </div>
  );
}


export default ConsultasAgendadas;
